def string_expansion(s):
    if not s:
        return ''
    result = ''
    i = 0
    while i < len(s):
        if s[i].isdigit():
            count = ''
            while i < len(s) and s[i].isdigit():
                count += s[i]
                i += 1
            i -= 1
            j = 1
            while j <= int(count):
                result += s[i].lower()
                if s[i].isupper():
                    result += s[i].upper()
                i += 1
                j += 1
        else:
            result += s[i]
            i += 1
    return result

