def string_expansion(s):
    result = ''
    temp = ''
    for char in s:
        if char.isalpha():
            if temp:
                result += temp * int(temp)
                temp = ''
            result += char
        elif char.isdigit():
            temp += char
        elif temp:
            result += temp * int(temp)
            temp = ''
    if temp:
        result += temp * int(temp)
    return result

